@-moz-document domain("godoc.org") {
/* No Headaches */
/* http://github.com/noHeadaches */
html > body {
  background-color: #282828;
  color: #D7728D; }
  html > body nav.navbar.navbar-default {
    background: #444;
    border: 0; }
    html > body nav.navbar.navbar-default ul.nav.navbar-nav > li > a:hover, html > body nav.navbar.navbar-default ul.nav.navbar-nav > li > a:focus {
      color: #D85D7F; }
    html > body nav.navbar.navbar-default ul.nav.navbar-nav > li:hover a {
      color: #D85D7F; }
    html > body nav.navbar.navbar-default ul.nav.navbar-nav > li.active a {
      background: #494949;
      color: #D7728D; }
    html > body nav.navbar.navbar-default a.navbar-brand {
      color: #D7728D; }
  html > body .jumbotron, html > body #x-projnav, html > body #x-search-query {
    background: #333; }
  html > body #x-search-query {
    color: #92BF91; }
  html > body pre {
    background: #333;
    border-color: #D7728D;
    color: #D85D7F; }
    html > body pre a {
      color: #92BF91; }
    html > body pre .com {
      color: #B5A1A1; }
  html > body #x-footer {
    background: #333; }
  html > body h1, html > body h2, html > body h3, html > body h4, html > body h5 {
    color: #92BF91; }
  html > body a {
    color: #B5A1A1; }
    html > body a:hover {
      color: rgba(181, 161, 161, 0.82); }
  html > body input.form-control {
    background: #333;
    color: #92BF91; }
}
